import React from 'react'
import Slider from 'react-slick'

let settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1
};

class Form extends React.Component {
    state = {
        inputValue: ''
    }
    render() {
        return(
            <form action="https://docs.google.com/forms/d/e/1FAIpQLSf2YbzVtPCINoBOqCpZ2zBLDfViR5xU1OY9qsG_jH7qVMPgtg/formResponse">
                <input hidden name="entry.1038519199" value={this.state.inputValue} />
                <h1>ktoru stranu ste volili 2016?</h1>
                <Slider>
                    <div onClick={() => this.setState({inputValue: 'saska'})}>saska</div>
                    <div onClick={() => this.setState({inputValue: 'smer'})}>smer</div>
                    <div onClick={() => this.setState({inputValue: 'kdh'})}>kdh</div>
                </Slider>
                <button type="submit">submit</button>
            </form>
        )
    }
}

export default Form
